DROP TABLE IF EXISTS `_playlist_content`;
DROP TABLE IF EXISTS `_songs`;
DROP TABLE IF EXISTS `_playlists`;
DROP TABLE IF EXISTS `_categories`;
DROP TABLE IF EXISTS `_artists`;
DROP TABLE IF EXISTS `_users`;
CREATE TABLE IF NOT EXISTS `_users`
(
    `user_id` SMALLINT not null AUTO_INCREMENT COMMENT 'identifier of the user',
    `first_name` Varchar(100) not null COMMENT 'first name',
    `last_name` Varchar(100)  COMMENT 'last name',
    `mail` Varchar(100) not null COMMENT 'email address',
    `password` Varchar(100) not null COMMENT 'encrypted password',
    Primary Key (`user_id`)
)
ENGINE=InnoDB COMMENT='_users' CHARSET=utf8mb4 COLLATE=utf8mb4_bin
;
create  index `_users_PrimaryKey` on `_users` (`user_id` asc);

CREATE TABLE IF NOT EXISTS `_categories`
(
    `categ_id` SMALLINT not null AUTO_INCREMENT COMMENT 'identifier of the style of music',
    `title` Varchar(50)  COMMENT 'description of the style',
    Primary Key (`categ_id`)
)
ENGINE=InnoDB COMMENT='_categories' CHARSET=utf8mb4 COLLATE=utf8mb4_bin
;
create  index `_categories_categ_id` on `_categories` (`categ_id` asc);

create  index `_categories_Label` on `_categories` (`title` asc);

create  index `_categories_PrimaryKey` on `_categories` (`categ_id` asc);

CREATE TABLE IF NOT EXISTS `_artists`
(
    `artist_id` SMALLINT not null AUTO_INCREMENT COMMENT 'identifier of the artist',
    `name_` Varchar(100)  COMMENT 'complete name of the artist',
    `bio` LongText  COMMENT 'biography',
    `gender` Varchar(10)  COMMENT 'male, female, other',
    `date_of_birth` DateTime  COMMENT 'birthdate',
    Primary Key (`artist_id`)
)
ENGINE=InnoDB COMMENT='_artists' CHARSET=utf8mb4 COLLATE=utf8mb4_bin
;
create  index `_artists_artist_id` on `_artists` (`artist_id` asc);

create  index `_artists_PrimaryKey` on `_artists` (`artist_id` asc);

CREATE TABLE IF NOT EXISTS `_playlists`
(
    `playlist_id` SMALLINT not null AUTO_INCREMENT COMMENT 'identifier of the playlist or program',
    `title` Varchar(100)  COMMENT 'Name of playlist Musical Program',
    `creation_date` DateTime  COMMENT 'Creation Date of this playlist',
    `user_id` SMALLINT  COMMENT 'user id of the this playlist',
    Primary Key (`playlist_id`)
)
ENGINE=InnoDB COMMENT='_playlists' CHARSET=utf8mb4 COLLATE=utf8mb4_bin
;
create  index `_playlists_#user_id` on `_playlists` (`user_id` asc);

CREATE TABLE IF NOT EXISTS `_songs`
(
    `song_id` SMALLINT not null AUTO_INCREMENT COMMENT 'identifier of the song',
    `Title` Varchar(100)  COMMENT 'title of Song',
    `release_date` DateTime  COMMENT 'date of release',
    `categ_id` SMALLINT  COMMENT 'category identifier (style) of this song',
    `artist_id` SMALLINT  COMMENT 'artist identifier of this song',
    `BPM` Double  COMMENT 'Rhythm of Song approx of average',
    `Year` Double  COMMENT 'Date of song',
    `Time` DateTime  COMMENT 'Duration of Song in Min:Sec',
    Primary Key (`song_id`)
)
ENGINE=InnoDB COMMENT='_songs' CHARSET=utf8mb4 COLLATE=utf8mb4_bin
;
create  index `_songs_#artist_id` on `_songs` (`artist_id` asc);

create  index `_songs_#categ_id` on `_songs` (`categ_id` asc);

CREATE TABLE IF NOT EXISTS `_playlist_content`
(
    `playlist_id` SMALLINT not null COMMENT 'Same as ProgramID in Programs',
    `song_id` SMALLINT not null COMMENT 'Updated as SongID in Songs, but can be modified without cascade song updating',
    `Position` Double  COMMENT 'Position of Song in Program',
    Primary Key (`playlist_id`,`song_id`)
)
ENGINE=InnoDB COMMENT='_playlist_content' CHARSET=utf8mb4 COLLATE=utf8mb4_bin
;
-- Exporter Relation _artists_songs
   Alter Table `_songs`
         add constraint `fk__artists_songs` foreign key (`artist_id`)
             references `_artists` (`artist_id`);
 
-- Exporter Relation _categories_songs
   Alter Table `_songs`
         add constraint `fk__categories_songs` foreign key (`categ_id`)
             references `_categories` (`categ_id`);
 
-- Exporter Relation _playlists_playlist_content
   Alter Table `_playlist_content`
         add constraint `fk__playlists_playlist_content` foreign key (`playlist_id`)
             references `_playlists` (`playlist_id`);
 
-- Exporter Relation _songs_playlist_content
   Alter Table `_playlist_content`
         add constraint `fk__songs_playlist_content` foreign key (`song_id`)
             references `_songs` (`song_id`);
 
-- Exporter Relation _users_playlists
   Alter Table `_playlists`
         add constraint `fk__users_playlists` foreign key (`user_id`)
             references `_users` (`user_id`);
 
